import "././assets/css/style.css";
import "././assets/css/bootstrap.min.css";
import "././assets/css/font-awesome.min.css";
import {
  NavLink,
  Redirect,
  Route,
  BrowserRouter as Router,
  Switch,
} from "react-router-dom";
import LinearProgress from "@mui/material/LinearProgress";
import React, { Suspense, lazy } from "react";
import logo from "./assets/images/epsilon.svg";
import { History } from "history";

import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';

const DashboardContainer = lazy(
  () => import("./pages/Dashboard/DashboardContainer")
);
const FormContainer = lazy(() => import("./pages/Form/FormContainer"));
interface AppProps {
  history: History;
}

export const App: React.FC<AppProps> = () => {
  return (
    <Router>
      <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            News
          </Typography>
          <Button color="inherit">Login</Button>
        </Toolbar>
      </AppBar>
    </Box>

      <div data-component="sidebar">
        <div className="sidebar">
          <ul className="list-group flex-column d-inline-block first-menu">
            <li className="list-group-item pl-3 py-2">
              <NavLink to={"/"}>
                <i className="fa fa-tv" aria-hidden="true">
                  <span className="ml-2 align-middle">CRUD APP</span>
                </i>
              </NavLink>

              <ul className="list-group flex-column d-inline-block submenu">
                <li className="list-group-item pl-4">
                  <NavLink to={`/dashboard`}>Dashboard</NavLink>
                </li>
                <li className="list-group-item pl-4">
                  <NavLink to={`/form`}>New Form</NavLink>
                </li>
              </ul>
            </li>
          </ul>
        </div>
      </div>

      <div className="wp-content">
        <div className="container-fluid">
          <Suspense fallback={<LinearProgress />}>
            <Switch>
              <Redirect from="/" to={`/dashboard`} exact={true} />
              <Route
                path={`/dashboard`}
                exact={true}
                component={DashboardContainer}
              />
              <Route path={`/form`} exact={true} component={FormContainer} />
            </Switch>
          </Suspense>
        </div>
      </div>
    </Router>
  );
};
